@ProudElephantUS As a registered liberal Democrat, for the first time I am voting Republican as a vote against Democrats for two main reasons:
1. Trampled on individual freedoms and liberties with national Covid vaccine mandate and Dem Governors imposed lockdowns.
2. Neoconservatism/Ukraine war.

@SlayerPutin @KevinCastley @FuzzySkeptic The international response is what annoys me. Russia invades Ukraine based on a false premise, and they get shunned by the entire western world for it.

US invades Iraq over a false premise, and gets soft criticism at the very worst. 

Hypocrisy is the problem.
